import { Link } from "react-router-dom";

function handleClick() {
    return (
        <Link to="/login"></Link>
    )
}

export const Home = () =>
    <div>
        <h1>Welcome to NookTracker!</h1>
        <button onClick={handleClick}>Login/Register</button>
    </div>
